import React, { Component } from 'react';
import {BrowserRouter} from 'react-router-dom';

import './App.css';
import Components from './components/components';

class App extends Component {
  render() { 
    return (
      <div>
        <BrowserRouter>
          <Components />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
